import react from 'react';
import { Container, Header, Button, Icon } from 'semantic-ui-react';
import Layout from '../../components/layout';

const HomepageHeading = (
    <Container text>
      <Header
        as='h1'
        content='Imagine-a-Company'
        inverted
        style={{
          fontSize:'4em',
          fontWeight: 'normal',
          marginBottom: 0,
          marginTop:'3em',
        }}
      />
      <Header
        as='h2'
        content='Do whatever you want when you want to.'
        inverted
        style={{
          fontSize: '1.7em',
          fontWeight: 'normal',
          marginTop:'1.5em',
        }}
      />
      <Button primary size='huge'>
        Get Started
        <Icon name='right arrow' />
      </Button>
    </Container>
  )


const success = () => {
    return (
        <Layout>
            <Container text>
            <Header
                as='h1'
                content='Imagine-a-Company'
                style={{
                fontSize:'4em',
                fontWeight: 'normal',
                marginBottom: 0,
                marginTop:'3em',
                }}
            />
            <Header
                as='h2'
                content='Do whatever you want when you want to.'
                inverted
                style={{
                fontSize: '1.7em',
                fontWeight: 'normal',
                marginTop:'1.5em',
                }}
            />
            <Button primary size='huge'>
                Get Started
                <Icon name='right arrow' />
            </Button>
            </Container>
        </Layout>
      )
}


export default success;
